text:
Specialus leidinys yra skirtas vieno geriausių „Queen“ albumų 40-mečiui pažymėti – „News Of The World“ originalas pasirodė 1977 m. Naujai išleistas „News Of The World“ albumas išsiskiria turiniu. Specialioje pakuotėje melomanai ras 3 CD: originalų albumą, iš alternatyvių dainų versijų sudarytą albumo versiją „Raw Sessions“ ir papildomą CD su iki šiol niekur neskelbtais įrašais. Ypač išskiriama „Raw Sessions“ albumo versija, kur atsidūrė naujai suskambėjusios visos 11 originalaus albumo dainų. Daugumoje kūrinių skamba iki šiol negirdėtos vokalo partijos ir instrumentuotės. Daugeliui melomanų negirdėta klasikinės dainos „We Are The Champions“ versija – šis kūrinys pirmąkart yra išleistas pilnos trukmės. „Raw Sessions“ albumo dainoje „All Dead, All Dead“, kurią originaliai sudainavo Brian May, skamba paties Freddie Mercury balsas. „Queen“ jubiliejiniame leidinyje taip pat yra analoginiu būdu perrašyta originali albumo vinilo plokštelė, kurioje įamžinti neapdoroti įrašai iš analoginiu būdu įrašytų juostų. Didžiausi grupės fanai jau dbar gali džiaugtis trimis plakatais ir 60 puslapių bukletu su iki šiol nepublikuotomis nuotraukomis. Taip pat, jubiliejiniame albume yra DVD diskas, kuriame įamžintas valandos trukmės dokumentinis filmas iš grupės gastrolių Jungtinėse Amerikos Valstijose – „Queen“ : The American Dream“. Vienintelį Baltijos šalyse grupės „Queen“ koncertą pristato didžiausias Baltijos šalių koncertų rengėjas „Live Nation Lietuva“. „Queen“ jubiliejino albumo „News Of The World 40“ video: (function(d, s, i, r) {
